import React from 'react';
import Nav from './Nav.js';
import Router from './Router.js';
import "./index.css";
import Footer from './Footer.js';
import '../node_modules/bootstrap/dist/css/bootstrap.min.css';

const App = (props) => {
  return (
    <>
      <Nav/>
      <Router/>
      <Footer/>
    </>
  );
}

export default App;
